-- CreateTable: hospitals (MOPH reference data)
CREATE TABLE "hospitals" (
    "id" SERIAL NOT NULL,
    "hcode_9" VARCHAR(9) NOT NULL,
    "hcode_5" VARCHAR(5),
    "name_thai" VARCHAR(200) NOT NULL,
    "hospital_level" VARCHAR(60),
    "address" VARCHAR(200),
    "province" VARCHAR(100) NOT NULL,
    "district" VARCHAR(100),
    "subdistrict" VARCHAR(100),
    "moo" VARCHAR(10),
    "postal_code" VARCHAR(5),
    "parent_network" VARCHAR(200),
    "data_updated_at" VARCHAR(20),
    "is_active" BOOLEAN NOT NULL DEFAULT true,
    "created_at" TIMESTAMPTZ(6) NOT NULL DEFAULT CURRENT_TIMESTAMP,
    "updated_at" TIMESTAMPTZ(6) NOT NULL DEFAULT CURRENT_TIMESTAMP,

    CONSTRAINT "hospitals_pkey" PRIMARY KEY ("id")
);

-- CreateIndex
CREATE UNIQUE INDEX "hospitals_hcode_9_key" ON "hospitals"("hcode_9");
CREATE UNIQUE INDEX "hospitals_hcode_5_key" ON "hospitals"("hcode_5");
CREATE INDEX "idx_hospitals_province" ON "hospitals"("province");

-- Seed hospital data (1,218 rows)

-- Add source_hospital_id FK column to patient_cases
ALTER TABLE "patient_cases" ADD COLUMN "source_hospital_id" INTEGER;

-- Migrate existing hospital code data to FK (5 unique codes, 208 cases)
UPDATE patient_cases
SET source_hospital_id = h.id
FROM hospitals h
WHERE h.hcode_5 = patient_cases.source_hospital_code_5
  AND patient_cases.source_hospital_code_5 IS NOT NULL;

-- Drop old hospital code columns
ALTER TABLE "patient_cases" DROP COLUMN "source_hospital_code_5";
ALTER TABLE "patient_cases" DROP COLUMN "source_hospital_code_10";

-- AddForeignKey
ALTER TABLE "patient_cases" ADD CONSTRAINT "patient_cases_source_hospital_id_fkey" FOREIGN KEY ("source_hospital_id") REFERENCES "hospitals"("id") ON DELETE SET NULL ON UPDATE CASCADE;
